import React from 'react';
import './App.css';
import sample from './Lightning.mp4'

class App extends React.Component
{
  constructor(props)
  {
    super(props)
    this.state = {
      weather: sample
    }

  }
  render()
  {
    return (
    <div className={this.state.weather} video autoPlay loop muted>
    <source src={this.state.weather} type='video/mp4' />


      <input type="text"></input>
      <h2>Enter your name</h2>


      </div>
    )
  }
}

export default App;
